import React from 'react';
import {NavLink} from 'react-router-dom'




const Header = () => {
  return (

    <nav class="navbar navbar-expand-lg  navbar-dark bg-dark d-flex justify-content-between">
  <div className="nav-title">
  <a class="text-light title-header">Daniel Bradley</a>
  </div>
  <div className="nav-items">
  <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>
  <div class="collapse navbar-collapse  p-4" id="navbarNavAltMarkup">
    <div class="navbar-nav">
      <a class="nav-item nav-link active text-light header-text" href="/about"><NavLink activeClassName="active" to='/about'>About</NavLink>About</a>
      <a class="nav-item nav-link text-light header-text" href="/portfolio" >Portfolio</a>
      <a class="nav-item nav-link text-light header-text" href="/resume" >Resume</a>
      <a class="nav-item nav-link text-light header-text" href="/contact" onClick={handleClick}>Contact</a>

    </div>
    </div>
  </div>
</nav>


  );
};

export default Header;
